import "../index.css";
import "../styles/TargetCore.css";
function TargetCore({ x, y }) {
  console.log(x, y, "Target");
  return (
    <div
      className="targetCircle"
      style={{
        top: `${x}px`,
        left: `${y}px`,
      }}
    ></div>
  );
}

export default TargetCore;
